import React from 'react';

class Contador extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    }
  }
  render() {
    return (
      <div className="counter">
        <div className="count">
          {this.state.count}
        </div>
        <div className="chageCounter">
          <a href="#" className="upCount">Up </a>
          <a href="#" className="downCount">Down </a>
          <a href="#" className="resetCount">Reset</a>
        </div>
      </div>
    )
  }
}

export default Contador;
